export const MoreProducts = () => {
  return (
    <>
      <div class="carousel-inner">
        <div class="carousel-item">
          <div class="container-fluid">
            <div class="row">
              <div class="col-md-6">
                <div class="detail-box">
                  <h1>Mercedes-Benz</h1>
                  <div class="btn-box"></div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
